import React, { useState } from "react";
import { Switch, Route, useRouteMatch, Link } from "react-router-dom";
import "./NewAnnonce.css";

import AnnonceRoute from "./CreateAnnonce";

function CreateAnnonce() {
  let { path } = useRouteMatch();

  return (
    <div>
      <Switch>
        <Route exact path={path}>
          <div className="createAnnonceMainDiv">
            <div className="chooseMainCategoryDiv">
              <Link to={`${path}/ny/bolig/asdfghj`}>Bolig</Link>
              <hr/>
              <Link to={`${path}/ny/bil/zxcvbn`}>Bil</Link>
            </div>
          </div>
        </Route>
        <Route path={`${path}/ny/:category/:annonceId`}>
          <AnnonceRoute></AnnonceRoute>
        </Route>
      </Switch>
    </div>
  );
}

export default CreateAnnonce;
